                <div className='col-2'>
                    <img src={squealerLogo} id='navbar-logo'></img>
                    <ul id='navbar-menu-container gap-2'>
                        <li><a href='' className='navbar-anchor fs-4 navbar-active'><i className="bi bi-house-fill me-3"></i>Home</a></li>
                        <li><a href='' className='navbar-anchor fs-4'><i className="bi bi-house-fill me-3"></i>Home</a></li>
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default Navbar;
